.ListOfGifs{ display: grid; min-height: 100vh; grid-template-columns: repeat(auto-fit,minmax(300px , 1fr)); grid-gap: 0 16px ; } . . Tambien en vez de poner auto-fit podriamos poner auto-fill . . .ListOfGifs{ display: grid; min-height: 100vh; grid-template-columns: repeat(auto-fill,minmax(300px , 1fr)); grid-gap: 0 16px ; } . . Podemos centrar los elementos entre cada fila con align-items: center . .
.ListOfGifs{ display: grid; min-height: 100vh; grid-template-columns: repeat(auto-fill,minmax(300px , 1fr)); align-items: center; } . . tambien le podemos poner una altura maxima con max-height .Gif-link{ color: #000; display: block; text-decoration: none; position: relative; width: 100%; max-height:300px; overflow: hidden;
}

