} Fichero ITokenService.cs Public interface ITokenService { Task GetToken(string scope); } Fichero TokenService.cs public class TokenService : ITokenService
{ private readonly ILogger _logger private readonly IOptions _identityServerSettings; private readonly DiscoveryDocumentResponse _discoveryDocument; public TokenService(ILogger logger, IOptions identityServerSettings) { _logger = logger; _identityServerSettings = identityServerSettings; using var httpClient = new HttpClient(); /* tal vez venga del paquete nuget IdentityModel*/ _discoveryDocument = httpClient.GetDiscoveryDocumentAsyng(identityServerSettings.Value.DiscoveryUrl).Result; if (_discoveryDocument.IsError) { logger.LogError("Unable to get discovery documen. Error is :{_discoveryDocument.Error}"); throw new Exception("Unable to get discovery document", _discoveryDocument.Exception); } } public async Task GetToken(string scope) { using var client = new HttpClient(); /* Este metodo viene del packete nuget IdentityModel */ var tokenResponse = await client.ResquestClientCredentialsTokenAsync(new ClientCredentialsTokenRequest { Address = _discoveryDocument.TokenEndpoint, ClientId = _identityServerSettings.Value.ClientName, ClientSecret = _identityServerSettings.Value.ClientPassword, Scope = scope }); if (tokenResponse.IsError) { _logger.LogError("Unable to get token. Error is: {tokenResponse.Error}"); throw new Exception ("Unable to get token", tokenResponse.Exception); } return TokenResponse }
